// src/components/api/register/metadataApi.js

export const fetchMetadata = async () => {
  try {
    const res = await fetch("http://localhost:5000/metadata", {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
        Authorization: Bearer ${localStorage.getItem("token")}, // keep if backend requires auth
      },
    });

    if (!res.ok) {
      throw new Error("Failed to fetch metadata");
    }

    const data = await res.json();
    return data.data; // backend wraps enums inside data
  } catch (err) {
    console.error("Metadata fetch error:", err);
    throw err;
  }
};
